

DROP TABLE sm CASCADE CONSTRAINTS;
PROMPT DROPPING TB_GRADE...


CREATE TABLE sm
(
  STUDENT_NO         VARCHAR2(10) NOT NULL,
  DEPARTMENT_NO      VARCHAR2(10) NOT NULL,
  STUDENT_NAME       VARCHAR2(40) NOT NULL,
  STUDENT_SSN        VARCHAR2(14),
  STUDENT_ADDRESS    VARCHAR2(200),
  ENTRANCE_DATE      DATE,
  ABSENCE_YN         CHAR(1),
  COACH_PROFESSOR_NO VARCHAR2(20)
)
;
COMMENT ON COLUMN sm.STUDENT_NO  IS '학생 번호';
COMMENT ON COLUMN sm.DEPARTMENT_NO  IS '학과 번호';
COMMENT ON COLUMN sm.STUDENT_NAME  IS '학생 이름';
COMMENT ON COLUMN sm.STUDENT_SSN  IS '학생 주민번호';
COMMENT ON COLUMN sm.STUDENT_ADDRESS  IS '학생 주소';
COMMENT ON COLUMN sm.ENTRANCE_DATE  IS '입학 년도';
COMMENT ON COLUMN sm.ABSENCE_YN  IS '휴학 여부';
COMMENT ON COLUMN sm.COACH_PROFESSOR_NO  IS '지도 교수 번호';

ALTER TABLE sm
  ADD CONSTRAINT PK_STUDENT PRIMARY KEY (STUDENT_SSN);










